import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

          <img src="../image/31.png" />


        <p>
          Website đang trong quá trình xây dựng.
        </p>
        <p>Xin vui lòng quay lại sau.</p>

      </header>
    </div>
  );
}

export default App;
